import React, {useState} from 'react';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';

const Order = () => {
    const [open, setOpen] = useState(true);

    const handleClose = () => {
    setOpen(false);
  };
    return (
        <div>
        <Dialog open={open} onClose={handleClose}>
        <h2>Оформление заказа</h2>
        <DialogContent>
            <label htmlFor="name">Ваше имя</label>
            <br/>
            <input type="text" id='name' name='name' placeholder='Например Иван' />
            <br/>
            <label htmlFor="surname">Ваше фамилия</label>
            <br/>
            <input type="text" placeholder='Например Иванов' />
            <br/>
            <label htmlFor="email">Электронная почта</label>
            <br/>
            <input type="email" id='email' name='email' placeholder='example@mail.com' />
            <br/>
            <label htmlFor="">Ваш номер телефона</label>
            <br/>
            <input type="text" />
            <br/>
            <label htmlFor="country">Страна</label>
            <br/>
            <input type="text" name='country' id='country' placeholder='Страна' />
            <br/>
            <label htmlFor="city">Город</label>
            <br/>
            <input type="text" name='city' id='city' placeholder='Город' />
        </DialogContent>
        <DialogActions>
          <button>Заказать</button>
        </DialogActions>
      </Dialog>
        </div>
    );
};

export default Order;
